style.css:
/* Document body styling */
body {
    font-family: 'Arial', sans-serif;
    background-color: #f4f4f4;
    color: #333;
    line-height: 1.6;
    margin: 40px;
}

/* Header styling */
header {
    background-color: #333;
    color: #fff;
    text-align: center;
    padding: 10px 0;
}

header h1 {
    margin: 0;
    font-size: 2em;
}

header p {
    margin: 5px 0 0 0;
    font-style: italic;
}

/* Main content styling */
main {
    background-color: #fff;
    padding: 20px;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
}

/* Paragraph styling */
p {
    margin-bottom: 20px;
}

/* Link styling */
a {
    color: #007BFF;
    text-decoration: none;
    transition: color 0.3s;
}

a:hover {
    color: #0056b3;
}

/* Image styling */
img {
    max-width: 100%;
    display: block;
    margin: 20px 0;
}

/* Footer styling */
footer {
    margin-top: 20px;
    text-align: center;
    font-size: 0.8em;
    color: #666;
}

